    <div id="genre-control" style="
        position: fixed; top: 80px; left: 10px; z-index: 9999;
        background: rgba(0,0,0,0.6); color: white; padding: 8px 10px;
        border-radius: 8px; font-size: 13px;">
      <label style="display:block; margin-bottom:4px;">Filter by Genre</label>
      <select id="genreFilter" style="width:180px; padding:4px;">
        <option value='All'>All</option><option value='Rock'>Rock</option><option value='Other'>Other</option><option value='Country'>Country</option><option value='EDM'>EDM</option><option value='Alternative'>Alternative</option><option value='Pop'>Pop</option><option value='Hip-Hop'>Hip-Hop</option><option value='R&B'>R&B</option><option value='Other'>Other</option>
      </select>
      <div style="margin-top:6px; opacity:.8;">(affects “Individual Venues” layer)</div>
    </div>
    <script>
      var MAP       = feature_group_9b858950945da817f69064a1c21a421e._map;
      var VENUES    = feature_group_9b858950945da817f69064a1c21a421e;
      var LAYER_CITY= feature_group_6e6d055f42e02de065b41f95186f19a2;
      var LAYER_TOP = feature_group_65a4f89c487ccd07d11c77fbb00617b1;
      var LAYER_HEAT= heat_map_14b879fb5d74ab2d13daa1981e733d52;

      // UI → canonical alias map (so "Dance/Electronic" matches EDM)
      var CANON = {
        "Hip-Hop": ["Hip-Hop","Hip-Hop/Rap","Hip Hop","Rap"],
        "EDM": ["EDM","Dance/Electronic","Dance","Electronic","EDM/Dance"],
        "Rock": ["Rock"],
        "Country": ["Country"],
        "Pop": ["Pop"],
        "Latin": ["Latin","Reggaeton","Latin Urban"],
        "R&B": ["R&B","Rnb","Soul"],
        "Jazz": ["Jazz"],
        "Classical": ["Classical","Symphony"],
        "Metal": ["Metal"],
        "Alternative": ["Alternative","Indie"],
        "Folk": ["Folk","Americana"],
        "Reggae": ["Reggae","Dancehall"],
        "Comedy": ["Comedy"],
        "Other": ["Other"]
      };

      function toCanon(label) {
        if (CANON[label]) return label;
        for (var k in CANON) if (CANON[k].indexOf(label) !== -1) return k;
        return label;
      }

      function setLayerVisible(layer, show) {
        if (!MAP || !layer) return;
        if (show) { if (!MAP.hasLayer(layer)) MAP.addLayer(layer); }
        else      { if (MAP.hasLayer(layer)) MAP.removeLayer(layer); }
      }

      function applyGenreFilter(selected) {
        if (!VENUES || !VENUES.eachLayer) return;
        var genre = toCanon(selected);
        var filtered = (genre !== "All");

        // Ensure venues layer is visible when filtering
        setLayerVisible(VENUES, true);

        // Hide/show venue markers (both SVG and Icon)
        VENUES.eachLayer(function(m) {
          try {
            var g = (m && m.options && (m.options.feverGenre || m.options.genre)) || "Other";
            var show = (genre === "All" || g === genre);
            if (m._path)   m._path.style.display   = show ? "" : "none";
            if (m._icon)   m._icon.style.display   = show ? "" : "none";
            if (m._shadow) m._shadow.style.display = show ? "" : "none";
            if (m.setStyle) m.setStyle({opacity: show ? 1 : 0, fillOpacity: show ? 0.85 : 0});
            if (!show && m._popup && m._popup._container) m._popup._container.style.display = "none";
          } catch (e) {}
        });

        // Hide city/top/heat when filtering for clarity; restore on "All"
        setLayerVisible(LAYER_CITY, !filtered);
        setLayerVisible(LAYER_TOP,  !filtered);
        setLayerVisible(LAYER_HEAT, !filtered);
      }

      (function initGenreFilter() {
        var sel = document.getElementById('genreFilter');
        if (!sel) return setTimeout(initGenreFilter, 60);
        L.DomEvent.disableClickPropagation(sel.parentElement);
        applyGenreFilter("All");
        sel.addEventListener('change', function() { applyGenreFilter(this.value); });
      })();
    </script>

<script>
(function(){
  function findMap(){
    for (var k in window){
      try {
        var v = window[k];
        if (v && v.addLayer && v.removeLayer && v.getCenter && v._layers) return v;
      } catch(e){}
    }
    return null;
  }

  function setMarkerVisible(m, show){
    // Works for vector CircleMarkers AND icon markers
    if (m._path)   m._path.style.display   = show ? "" : "none";
    if (m._icon)   m._icon.style.display   = show ? "" : "none";
    if (m._shadow) m._shadow.style.display = show ? "" : "none";
    if (m.setStyle) m.setStyle({opacity: show ? 1 : 0, fillOpacity: show ? 0.85 : 0});
    if (!show && m._popup && m._popup._container) m._popup._container.style.display = "none";
  }

  function init(){
    var map = findMap();
    if (!map) return setTimeout(init, 120);

    // Collect all markers that have a genre tag
    var venues = [];
    Object.values(map._layers).forEach(function(layer){
      try {
        if (layer && layer.options && (layer.options.feverGenre || layer.options.genre)) {
          venues.push(layer);
        }
      } catch(e){}
    });

    if (!venues.length) return setTimeout(init, 200); // wait for markers to finish rendering

    // Build genre list from actual markers
    var genresSet = new Set(["All"]);
    venues.forEach(function(m){
      genresSet.add(m.options.feverGenre || m.options.genre || "Other");
    });
    var genres = Array.from(genresSet);

    // Create UI box
    var box = document.createElement('div');
    box.style.cssText = 'position:fixed;top:80px;left:10px;z-index:9999;background:rgba(0,0,0,.6);color:#fff;padding:8px 10px;border-radius:8px;font-size:13px;';
    box.innerHTML = '<label style="display:block;margin-bottom:4px;">Filter by Genre</label>';

    var sel = document.createElement('select');
    sel.id = 'genreFilter';
    sel.style.cssText = 'width:180px;padding:4px;';
    genres.forEach(function(g){
      var opt = document.createElement('option');
      opt.value = g; opt.textContent = g;
      sel.appendChild(opt);
    });
    box.appendChild(sel);
    var small = document.createElement('div');
    small.style.cssText = 'margin-top:6px;opacity:.8;';
    small.textContent = '(shows only matching venues)';
    box.appendChild(small);

    document.body.appendChild(box);
    if (window.L && L.DomEvent) L.DomEvent.disableClickPropagation(box);

    function applyFilter(val){
      venues.forEach(function(m){
        var g = m.options.feverGenre || m.options.genre || "Other";
        setMarkerVisible(m, val === "All" || g === val);
      });
    }

    sel.addEventListener('change', function(){ applyFilter(this.value); });
    applyFilter('All');
  }

  document.addEventListener('DOMContentLoaded', init);
})();
</script>
<!-- ===== /Genre Filter ===== -->
